		'idicontainer' => 'container',
		'ndicontainer' => 'container',
	);

	public $meta = array();


	public function __construct()
	{
		parent::__construct(array(
			'appDir' => 'D:\\stranky\\!__NETTE\\zapisy\\app',
			'wwwDir' => 'D:/stranky/!__NETTE/zapisy/www',
			'productionMode' => FALSE,
			'environment' => 'development',
			'consoleMode' => FALSE,
			'container' => array(
				'class' => 'SystemContainer',
				'parent' => 'NDIContainer',
			),
			'tempDir' => 'D:\\stranky\\!__NETTE\\zapisy\\app/../temp',
			'database' => array(
				'driver' => 'mysql',
				'host' => 'localhost',
				'dbname' => 'sokolbreznik',
				'database' => 'sokolbreznik',
				'user' => 'root',
				'password' => NULL,
				'charset' => 'utf8',
				'lazy' => TRUE,
			),
		));
	}


	/**
	 * @return NApplication
	 */
	protected function createServiceApplication()
	{
		$service = new NApplication($this->{'nette.presenterFactory'}, $this->router, $this->httpRequest, $this->httpResponse);
		$service->catchExceptions = FALSE;
		$service->errorPresenter = NULL;
		NRoutingDebugger::initializePanel($service);
		NDebugger::$bar->addPanel(new NRoutingDebugger($this->router, $this->httpRequest));
		return $service;
	}


	/**
	 * @return NFileStorage
	 */
	protected function createServiceCacheStorage()
	{
		$service = new NFileStorage('D:\\stranky\\!__NETTE\\zapisy\\app/../temp/cache', $this->{'nette.cacheJournal'});
		return $service;
	}


	/**
	 * @return NDINestedAccessor
	 */
	protected function createServiceConstants()
	{
		$service = new NDINestedAccessor($this, 'constants');
		return $service;
	}


	/**
	 * @return NDIContainer
	 */
	protected function createServiceContainer()
	{
		return $this;
	}


	/**
	 * @return DibiConnection
	 */
	protected function createServiceDatabase()
	{
		$service = new DibiConnection(array(
			'driver' => 'mysql',
			'host' => 'localhost',
			'dbname' => 'sokolbreznik',
			'database' => 'sokolbreznik',
			'user' => 'root',
			'password' => NULL,
			'charset' => 'utf8',
			'lazy' => TRUE,
		));
		return $service;
	}


	/**
	 * @return NHttpRequest
	 */
	protected function createServiceHttpRequest()
	{
		$service = $this->{'nette.httpRequestFactory'}->createHttpRequest();
		if (!$service instanceof NHttpRequest) {
			throw new UnexpectedValueException('Unable to create service \'httpRequest\', value returned by factory is not NHttpRequest type.');
		}
		return $service;
	}


	/**
	 * @return NHttpResponse
	 */
	protected function createServiceHttpResponse()
	{
		$service = new NHttpResponse;
		return $service;
	}


	/**
	 * @return Model
	 */
	protected function createServiceModel()
	{
		$service = new Model($this->database);
		return $service;
	}


	/**
	 * @return NDINestedAccessor
	 */
	protected function createServiceNette()
	{
		$service = new NDINestedAccessor($this, 'nette');
		return $service;
	}


