		return $service;
	}


	/**
	 * @return NConnection
	 */
	protected function createServiceNette_database_default()
	{
		$service = new NConnection('mysql:host=localhost;dbname=sokolbreznik', 'root', NULL, NULL);
		$service->setCacheStorage($this->cacheStorage);
		NDebugger::$blueScreen->addPanel('NDatabasePanel::renderException');
		$service->setDatabaseReflection(new NDiscoveredReflection($this->cacheStorage));
		$service->onQuery[] = array(
			$this->{'nette.database.defaultConnectionPanel'},
			'logQuery',
		);
		return $service;
	}


	/**
	 * @return NDatabasePanel
	 */
	protected function createServiceNette_database_defaultConnectionPanel()
	{
		$service = new NDatabasePanel;
		$service->explain = TRUE;
		NDebugger::$bar->addPanel($service);
		return $service;
	}


