	 */
	protected function createServiceNette_presenterFactory()
	{
		$service = new NPresenterFactory('D:\\stranky\\!__NETTE\\zapisy\\app', $this);
		return $service;
	}


	/**
	 * @return NFileTemplate
	 */
	public function createNette_template()
	{
		$service = new NFileTemplate;
		$service->registerFilter($this->createNette_latte());
		$service->registerHelperLoader('NTemplateHelpers::loader');
		return $service;
	}


	/**
